import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import './Cards.css';

function Cards() {
  return (
    <Row xs={1} md={2} className="grid">
      {Array.from({ length: 2 }).map((_, idx) => (
        <Col>
          <Card>
            <Card.Img variant="top" src="C:\WebDev\onlineStore2\public\Img1.jpg" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                Img will go here. 
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </Row> 
  );
}

function SqrBoxes() {
  return (
    <Row className='sqr'> 
      {Array.from({ length: 2 }).map((_, idx) => (
        <Col>
          <Card>
            <Card.Img variant="top" src="C:\WebDev\onlineStore2\public\Img1.jpg" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                Img will go here. 
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </Row>
  );
} 

export default Cards; SqrBoxes;
